import React, {useState} from 'react'
import Tarea from './tareas'

const enviarTarea = (e, tarea, setTarea)=>{
    e.preventDefault()

    setTarea([...tarea, {id: 10, nota: 'Nueva Tarea'}])
}

export default ()=>{
    const [tarea, setTarea] = useState([
        {id: 1, nota: "tare"}
    ])
}
